import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
	const items = props.items;
	const expenseItems = items.map((item) => (
		<ExpenseItem
			key={item.id}
			title={item.title}
			amount={item.amount}
			date={item.date}
		></ExpenseItem>
	));

	return <div className="expenses">{expenseItems}</div>;
}
export default Expenses;
